import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First add an item to cart to ensure we have something to update
    await page.evaluate(() => {
      addToCart(1); // Add product with ID 1 to cart
    });

    // Wait for cart counter to update
    await page.waitForFunction(() => {
      const cartCount = document.querySelector('.cart-count');
      return cartCount && cartCount.textContent !== '0';
    }, { timeout: 5000 });

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart with initial quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Find and click the quantity increase button
    const plusButton = await page.$('.cart-item .quantity-btn:has-text("+")');
    await plusButton.click();

    // Wait for quantity to update
    await page.waitForFunction(() => {
      const quantityElement = document.querySelector('.cart-item .quantity');
      return quantityElement && quantityElement.textContent === '2';
    }, { timeout: 5000 });

    // Take screenshot of updated cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract data to verify the update
    const updatedQuantity = await page.$eval('.cart-item .quantity', el => el.textContent);
    const totalPrice = await page.$eval('#cartTotal', el => el.textContent);

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData: {
        newQuantity: updatedQuantity,
        totalPrice: totalPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
